import ShowPost from "../posts/showPost";
import { useEffect,useState } from "react";
import { useDispatch } from "react-redux";
import * as postActions from "../../store/"
const TodayDashboard = () =>{
    const dispatch = useDispatch();
    let randomPost = Math.floor(Math.random*50)+1
    const [test,setTest] = useState('')
    //all Today dashboard will be in here
    //select posts that were reblogged by 
    //todayonmumblr
    // in seeding, need to have posts reblogged by todayonmumblr
    useEffect(()=>{
        setTest(dispatch(postActions.fetchPost(randomPost)))
    });

    return (
        <ShowPost post={test} />
    );




}

export default TodayDashboard;
